import React from 'react';
import './navbar.scss';



export default function Logo(props) {



	return (
		<div onClick={()=>{props.callback(); console.log('click')}} className='logo' style={{'--logobg':props.color}}>
			Danielle
			<div className='logo-span'>Web Developer</div>
		</div>


	);

}
